    true,nt"url": null,nt"notes": "THIS DATA ASSET NO LONGER ACTIVE: This is
    metadata documentation for Web Air Permits in Region 7 (WAP R7), a Lotus Notes application
    that once tracked comment periods on air permits.  This work fell under objectives
    for EPA's 2006-2011 Strategic Plan (Goal 5) for Compliance and Environmental Stewardship
    which are to achieve environmental protection through improved compliance and environmental
    stewardship (i.e., monitoring and enforcement).  It was determined that this application
    was no longer used and was terminated on 5/22/2013. Data entries relating to air
    permits is now entered into an Excel spreadsheet and it is unclear if the original
    WAP database can be found.",nt"license_title": "Other License Specified",nt"extras":
